import React from 'react';
import ReactDOM from 'react-dom';
import Firebase, { FirebaseContext } from './utils/index';
import App from './App';


ReactDOM.render(
  <FirebaseContext.Provider value={new Firebase()}>
  <React.StrictMode>
    <App />
  </React.StrictMode>
  </FirebaseContext.Provider>,
  document.getElementById('root')
);
